import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { Row,Col } from 'react-bootstrap';

import MarketNews from './components/MarketNews';
import PriceList from './components/PriceList'
import MarketNewsData from './components/MarketNewsData'



function App() {
  return (
    <div className="App">
     <Row>
       <Col lg={3}>
       <PriceList/>
       <div className="market-header">
        <p>Market News</p>
      </div>
      <div className="ml-2">
      {MarketNewsData.map (data => <MarketNews key={data.id} title={data.title} text={data.text} date={data.date} /> )}
      </div>
       </Col>
       <Col lg={6}>
       <div className="w-100 bg-success" >
              <div class="tradingview-widget-container">
                <div id="tradingview_eb355"></div>
                <div class="tradingview-widget-copyright"><a href="https://www.tradingview.com/symbols/NASDAQ-AAPL/" rel="noopener" target="_blank"><span class="blue-text">AAPL Chart</span></a> by TradingView</div>
              </div>
            </div>
       </Col>
     </Row>
    </div>
  );
}

export default App;
